import { Navigate,} from "react-router-dom";

type MyProps = {
  children: JSX.Element;
  users: boolean;
};

export const ProtectedRoutes = ({ children, users }: MyProps): JSX.Element => {
  /* PROTECTED ROUTES */
  if (users) {
    return children;
  } else {
    return <Navigate to={"/"} />;
  }
};
